  [],\n\t\"revision_timestamp\": \"2016-07-27T22:19:16.725454\",\n\t\"name\": \"farallon-national-wildlife-refuge-annual-narrative-report-calendar-year-1996\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Farallon
  NWR outlines Refuge accomplishments during the 1996 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. The report includes
  a planning section which discusses research and investigations. Refuge administration
  is outlined; information about personnel, volunteer programs, and funding is given.
  Habitat management is also covered; subjects include forests, pest control, and
  wilderness areas. The wildlife section of the report discusses endangered and threatened
  species, waterfowl, marsh birds and waterbirds, shorebirds, raptors, marine mammals,
  fisheries resources, and marking and bird banding. The public uses of the Refuge
  described in this report include law enforcement. The equipment and facilities section
  of the report provides information about rehabilitation, major maintenance, and
  energy conservation. Items of interest are provided at the end.\",\n\t\"license_title\":
